import React from 'react';
import { observer } from 'mobx-react';
import cx from 'classnames';
import screenfull from 'screenfull';
import Mousetrap from 'mousetrap';
import { message, Modal } from 'antd';
import { CloseOutlined } from '@ant-design/icons';
import Dropdown, { MenuItemType, MenuItem } from '../../common/dropdown/Dropdown';
import {
  Rectangle,
  RectangleCenterline,
  FourDotsRect,
  RectangleLabel,
  Ellipse,
  Polygon,
  PolygonLabel,
  Line,
  Dot,
  Cuboid,
  LShape,
  Grid,
  Fullscreen,
  Save,
  Question,
  Connection,
  Labels,
  Undo,
  Redo,
  Measurement,
  Aim,
  MinusCircleFilled,
  PlusCircleFilled,
  Attributes,
  Hide,
  ClearAll,
} from '../../common/icons';
import UndoStore, { StoreData } from '../store/UndoStore';
import SettingsStore from '../store/SettingsStore';
import RelationshipsStore from '../store/RelationshipsStore';
import i18n from '../locales';
import { Tool, AttributesMode, ViewMode } from '../types';
import './Toolbar.scss';

const getToolIcon = (tool: Tool) => {
  switch (tool) {
    case Tool.RECTANGLE:
      return <Rectangle />;
    case Tool.FOUR_DOTS_RECTANGLE:
      return <FourDotsRect />;
    case Tool.CENTERLINE_RECTANGLE:
      return <RectangleCenterline />;
    case Tool.ELLIPSE:
      return <Ellipse />;
    case Tool.POLYGON:
      return <Polygon />;
    case Tool.CUBOID:
      return <Cuboid />;
    case Tool.LSHAPE:
      return <LShape />;
    case Tool.OCR:
      return <RectangleLabel />;
    case Tool.OCR_POLYGON:
      return <PolygonLabel />;
    case Tool.LINE:
      return <Line />;
    case Tool.DOT:
      return <Dot />;
    case Tool.GRID:
      return <Grid />;
    default:
  }
  return null;
};

interface ToolbarProps {
  readonly: boolean;
  tools: Tool[];
  currentTool: Tool;
  gridViewEnabled?: boolean;
  addMode: boolean;
  labelMode: boolean;
  viewScale: number;
  selectedInstanceId: string;
  selectedInstanceInCurrentFrame: boolean;
  updateData: (curr: StoreData, prev: StoreData) => void;
  onCurrentToolChanges: (tool: Tool) => void;
  onAddModeChanges: (addMode: boolean) => void;
  onLabelModeChanges: (labelMode: boolean) => void;
  onViewModeChanges: (viewMode: ViewMode) => void;
  onAttributesModeChanges: (activeMode: AttributesMode, type: string) => void;
  onViewReset: () => void;
  setViewScale: (scale: number) => void;
  updateHiddenShapes: () => void;
  onSave: () => void;
  onClear: () => void;
}

interface ToolbarState {
  scale: string;
  helpVisible: boolean;
}

@observer
class Toolbar extends React.Component<ToolbarProps, ToolbarState> {
  state = {
    scale: '',
    helpVisible: false,
  };

  componentDidMount() {
    Mousetrap.bind('space', (event) => {
      event.preventDefault();
      this.props.onAddModeChanges(!this.props.addMode);
    });
  }

  componentDidUpdate(prevProps: ToolbarProps) {
    if (prevProps.viewScale !== this.props.viewScale) {
      this.setState({ scale: `${this.props.viewScale.toFixed(2)}x` });
    }
  }

  componentWillUnmount() {
    Mousetrap.unbind('space');
  }

  handleUndo = () => {
    if (!UndoStore.undoDisabled) {
      const item = UndoStore.undo();
      if (item && item.before) {
        this.props.updateData(item.before, item.after);
        message.success(i18n.translate('UNDO_SUCCESS'));
      }
    }
  };

  handleRedo = () => {
    if (!UndoStore.redoDisabled) {
      const item = UndoStore.redo();
      if (item && item.after) {
        this.props.updateData(item.after, item.before);
        message.success(i18n.translate('REDO_SUCCESS'));
      }
    }
  };

  handleScreenFull = () => {
    if (screenfull.isEnabled) {
      screenfull.toggle();
    }
  };

  handleScaleChange = () => {
    const scaleValue = parseInt(this.state.scale, 10);
    if (!Number.isNaN(scaleValue)) {
      this.props.setViewScale(scaleValue);
    }
  };

  handleAttributesModeChange = (mode: string, _: number, item: MenuItem) => {
    const [type, value] = item.value!.split('-');
    this.props.onAttributesModeChanges(value as AttributesMode, type);
  };

  render() {
    const {
      readonly,
      tools,
      currentTool,
      gridViewEnabled,
      addMode,
      labelMode,
      viewScale,
      selectedInstanceId,
      selectedInstanceInCurrentFrame,
      onCurrentToolChanges,
      onLabelModeChanges,
      onViewModeChanges,
      onViewReset,
      setViewScale,
      updateHiddenShapes,
      onSave,
      onClear,
    } = this.props;
    const {
      measurementBoxList,
      activeMeasurementBoxIndex,
      viewMode,
      activeAttributesMode,
      activePointAttributesMode,
      hideOthers,
    } = SettingsStore;
    const relationships = RelationshipsStore.getConfig();
    const measurements = measurementBoxList ? [i18n.translate('COMMON_HIDE'), ...measurementBoxList.map((box) => `${box[0]}*${box[1]}px`)] : [];
    const isGridView = viewMode === ViewMode.GRID;
    return (
      <div className="toolbar">
        <div>
          {Object.values(Tool).map((tool) => tools.includes(tool) && (
            <div
              key={tool}
              className={cx('icon-button', {
                'icon-button--active': !readonly && currentTool === tool && addMode,
                'icon-button--disabled': readonly,
              })}
              onClick={() => onCurrentToolChanges(tool)}
            >
              {getToolIcon(tool)}
            </div>
          ))}
          <div className="divider" />
          <div
            className={cx('icon-button', {
              'icon-button--disabled': readonly || UndoStore.undoDisabled,
            })}
            onClick={this.handleUndo}
          >
            <Undo />
          </div>
          <div
            className={cx('icon-button', {
              'icon-button--disabled': readonly || UndoStore.redoDisabled,
            })}
            onClick={this.handleRedo}
          >
            <Redo />
          </div>
        </div>
        <div>
          {gridViewEnabled && (
            <div className="view-mode">
              <div className={cx({ checked: !isGridView })} onClick={() => onViewModeChanges(ViewMode.DEFAULT)}>
                {i18n.translate('VIEW_MODE_DEFAULT')}
              </div>
              <div className={cx({ checked: isGridView })} onClick={() => onViewModeChanges(ViewMode.GRID)}>
                {i18n.translate('VIEW_MODE_GRID')}
              </div>
            </div>
          )}
        </div>
        <div>
          {relationships && (
            <Dropdown
              className={cx('icon-button', {
                'icon-button--active': RelationshipsStore.isTempRelationshipActive(),
                'icon-button--disabled': readonly || !selectedInstanceInCurrentFrame,
              })}
              menu={relationships}
              disabled={readonly || !selectedInstanceInCurrentFrame}
              onClick={(relation) => RelationshipsStore.setTempRelationship(selectedInstanceId, relation)}
            >
              <Connection />
            </Dropdown>
          )}
          <div
            className={cx('icon-button', {
              'icon-button--active': hideOthers,
            })}
            onClick={() => {
              SettingsStore.hideOthers = !hideOthers;
              updateHiddenShapes();
            }}
          >
            <Hide />
          </div>
          <div
            className="icon-button"
            onClick={() => {
              Modal.confirm({
                title: i18n.translate('CLEAR_CONFIRM_TITLE'),
                content: i18n.translate('CLEAR_CONFIRM_DESC'),
                autoFocusButton: null,
                okText: i18n.translate('COMMON_YES'),
                okType: 'danger',
                cancelText: i18n.translate('COMMON_CANCEL'),
                onOk() {
                  onClear();
                },
              });
            }}
          >
            <ClearAll />
          </div>
          <div className="view-scale">
            <div
              className={cx('icon-button', {
                'icon-button--disabled': isGridView,
              })}
              onClick={() => setViewScale(viewScale / 2)}
            >
              <MinusCircleFilled />
            </div>
            <input
              disabled={isGridView}
              value={this.state.scale}
              onChange={(e) => this.setState({ scale: e.target.value })}
              onBlur={this.handleScaleChange}
              onKeyUp={(e) => {
                if (e.key === 'Enter') {
                  this.handleScaleChange();
                }
              }}
            />
            <div
              className={cx('icon-button', {
                'icon-button--disabled': isGridView,
              })}
              onClick={() => setViewScale(viewScale * 2)}
            >
              <PlusCircleFilled />
            </div>
          </div>
          <div
            className={cx('icon-button', {
              'icon-button--disabled': isGridView,
            })}
            onClick={onViewReset}
          >
            <Aim />
          </div>
          {measurementBoxList && (
            <>
              <div
                className={cx('icon-button', {
                  'icon-button--active': activeMeasurementBoxIndex >= 0,
                })}
              >
                <Measurement />
              </div>
              <Dropdown
                arrow
                style={{ paddingRight: 6, height: '100%' }}
                menu={measurements.map((m, i) => ({ label: m, active: i - 1 === activeMeasurementBoxIndex }))}
                onClick={(_, index) => SettingsStore.setActiveMeasurementBox(index - 1)}
              >
                {measurements[activeMeasurementBoxIndex + 1]}
              </Dropdown>
            </>
          )}
          <Dropdown
            arrow
            showIcon
            style={{ paddingRight: 6, height: '100%' }}
            menuStyle={{ width: 120 }}
            menu={[
              { label: i18n.translate('ATTRIBUTES_MODE_POINT'), type: MenuItemType.TITLE },
              ...Object.values(AttributesMode).map((mode) => ({
                label: i18n.translate(`ATTRIBUTES_MODE_${mode.toUpperCase()}`),
                value: `point-${mode}`,
                active: mode === activePointAttributesMode,
              })),
              { label: i18n.translate('ATTRIBUTES_MODE_SHAPE'), type: MenuItemType.TITLE },
              ...Object.values(AttributesMode).map((mode) => ({
                label: i18n.translate(`ATTRIBUTES_MODE_${mode.toUpperCase()}`),
                value: `shape-${mode}`,
                active: mode === activeAttributesMode,
              })),
            ]}
            onClick={this.handleAttributesModeChange}
          >
            <div
              className={cx('icon-button', {
                'icon-button--active': activeAttributesMode !== AttributesMode.HIDE || activePointAttributesMode !== AttributesMode.HIDE,
              })}
              style={{ paddingRight: 0 }}
            >
              <Attributes />
            </div>
          </Dropdown>
          <div
            className={cx('icon-button', {
              'icon-button--active': labelMode,
            })}
            onClick={() => onLabelModeChanges(!labelMode)}
          >
            <Labels />
          </div>
          <div className="icon-button" onClick={onSave}>
            <Save />
          </div>
          <div
            className={cx('icon-button', {
              'icon-button--active': this.state.helpVisible,
            })}
            onClick={() => this.setState({ helpVisible: true })}
          >
            <Question />
          </div>
          <div className="icon-button" onClick={this.handleScreenFull}>
            <Fullscreen />
          </div>
        </div>
        {this.state.helpVisible && (
          <div className="help-panel">
            <div className="title">
              {i18n.translate('HELP_TITLE')}
              <div className="close" onClick={() => this.setState({ helpVisible: false })}>
                <CloseOutlined />
              </div>
            </div>
            <div className="section-box">
              <div className="section">
                <div className="section-title">{i18n.translate('HELP_SECTION_MAIN_TITLE')}</div>
                <div className="section-content">
                  <div className="help-item">
                    <div>{i18n.translate('HELP_RIGHT_MOUSE_LABEL')}</div>
                    <div>{i18n.translate('HELP_RIGHT_MOUSE_DESC')}</div>
                  </div>
                  <div className="help-item">
                    <div>{i18n.translate('HELP_MOUSE_SCROLL_LABEL')}</div>
                    <div>{i18n.translate('HELP_MOUSE_SCROLL_DESC')}</div>
                  </div>
                  <div className="help-item">
                    <div>Ctrl / Cmd + S</div>
                    <div>{i18n.translate('HELP_SAVE_DESC')}</div>
                  </div>
                  <div className="help-item">
                    <div>,</div>
                    <div>{i18n.translate('HELP_PREV_FRAME_DESC')}</div>
                  </div>
                  <div className="help-item">
                    <div>.</div>
                    <div>{i18n.translate('HELP_NEXT_FRAME_DESC')}</div>
                  </div>
                  <div className="help-item">
                    <div>{'<'}</div>
                    <div>{i18n.translate('HELP_PREV_FRAME_10_DESC')}</div>
                  </div>
                  <div className="help-item">
                    <div>{'>'}</div>
                    <div>{i18n.translate('HELP_NEXT_FRAME_10_DESC')}</div>
                  </div>
                  <div className="help-item">
                    <div>/</div>
                    <div>{i18n.translate('HELP_PLAY_DESC')}</div>
                  </div>
                  <div className="help-item">
                    <div>Shift + L</div>
                    <div>{i18n.translate('HELP_ASSISTANT_LINE_DESC')}</div>
                  </div>
                  <div className="help-item">
                    <div>Alt / Option + T</div>
                    <div>{i18n.translate('HELP_AUTO_OCR_DESC')}</div>
                  </div>
                </div>
              </div>
              <div className="section">
                <div className="section-title">{i18n.translate('HELP_SECTION_SHAPE_TITLE')}</div>
                <div className="section-content">
                  <div className="help-item">
                    <div>Space</div>
                    <div>{i18n.translate('HELP_CREATE_DESC')}</div>
                  </div>
                  <div className="help-item">
                    <div>Delete / Backspace</div>
                    <div>{i18n.translate('HELP_REMOVE_DESC')}</div>
                  </div>
                  <div className="help-item">
                    <div>Alt / Option + P</div>
                    <div>{i18n.translate('HELP_CONVERT_DESC')}</div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        )}
      </div>
    );
  }
}

export default Toolbar;
